        public static readonly string Information = @"
Library implemented by Ladislav Heller, ladislav.heller@gmail.com

Constellation boundary data were taken from
http://pbarbier.com/constellations/boundaries.html

Constellation boundaries were approved by IAU in year 1928 and published in 1930
https://iau.org/public/themes/constellations/";

        /// <summary>
        /// Used by public methods to tell/get the location of constellations on the celestial sphere
        /// </summary>
        public enum HemiSphere {
            North,
            Equatorial,
            South
        }

        /// <summary>
        /// Properties of one IAU constellation
        /// Coordinates are from the polar r/φ coordinate system
        /// r => declination
        /// φ => right ascension
        /// </summary>
        public struct ConstellationDataPolar {
            public string LatinName;
            public HemiSphere Location;
            public PointF Centroid;
            public float Area;
            public byte Rank;
            public PointF[] Boundary;
        }

        /// <summary>
        /// Properties of one IAU constellation with centroid and boundaries converted to XY coordinate system
        /// </summary>
        public struct ConstellationDataXY {
            public PointF Centroid;
            public PointF[] Boundary;
        }

