        /// <summary>
        /// All IAU constellation boundary data converted from polar to XY coordinates for North celestial sphere
        /// </summary>
        public static readonly Dictionary<string, ConstellationDataXY> NorthConstellations = new Dictionary<string, ConstellationDataXY>() { };

        /// <summary>
        /// All IAU constellation boundary data converted from polar to XY coordinates for South celestial sphere
        /// </summary>
        public static readonly Dictionary<string, ConstellationDataXY> SouthConstellations = new Dictionary<string, ConstellationDataXY>() { };

        /// <summary>
        /// Holds the XY coordinates of all constellation boundary line/arc segments expressed as North
        /// </summary>
        public static readonly Dictionary<string, PointF[]> NorthSegments = new Dictionary<string, PointF[]>() { };

        /// <summary>
        /// Holds the XY coordinates of all constellation boundary line/arc segments expressed as South
        /// </summary>
        public static readonly Dictionary<string, PointF[]> SouthSegments = new Dictionary<string, PointF[]>() { };

        /// <summary>
        /// Converts from radians to decimal degrees
        /// </summary>
        public static double Rad2Deg(double rad) {
            // Deg <= Rad * 180 / PI
            return rad * 57.295779513082323;
        }

        /// <summary>
        /// Converts from decimal degrees to radians
        /// </summary>
        public static double Deg2Rad(double deg) {
            // Rad <= Deg * PI / 180
            return deg * 0.0174532925199433;
        }

        // This method converts the list of polar coordinates to list of XY coordinates
        private static PointF[] Polar2XY(PointF[] p, HemiSphere hs) {
            var result = new List<PointF>();
            if (p.Length == 0) return result.ToArray();

            for (var i = 0; i < p.Length; i++) {
                var PHI = 0.0;     // right ascension
                var R = 0.0;       // declination
                switch (hs) {
                    case HemiSphere.North:
                        PHI = Deg2Rad(p[i].X);
                        R = 90.0f - p[i].Y;
                        break;
                    case HemiSphere.South:
                        PHI = Deg2Rad(-p[i].X);
                        R = 90.0f + p[i].Y;
                        break;
                }
                result.Add(new PointF((float)(R * Cos(PHI)), (float)(R * Sin(PHI))));
            }
            return result.ToArray();
        }

        // check whether the point P2 is left from edge [P0,P1]
        private static int IsLeft(PointF P0, PointF P1, PointF P2) {
            var calc = ((P1.Y - P0.Y) * (P2.X - P0.X) - (P2.Y - P0.Y) * (P1.X - P0.X));
            if (calc > 0)
                return 1;
            else if (calc < 0)
                return -1;
            else
                return 0;
        }

        // classic Point-In-Polygon algorythm
        private static bool IsPointInPolygon(PointF point, List<PointF> polygon) {
            var n = polygon.Count;
            polygon.Add(new PointF(polygon[0].X, polygon[0].Y));
            var v = polygon.ToArray();
            var wn = 0;    // the winding number counter
            // loop through all edges of the polygon
            for (int i = 0; i < n; i++) {
                if (v[i].X <= point.X) {
                    if (v[i + 1].X > point.X) if (IsLeft(v[i], v[i + 1], point) > 0) ++wn;
                }
                else {
                    if (v[i + 1].X <= point.X) if (IsLeft(v[i], v[i + 1], point) < 0) --wn;
                }
            }
            if (wn != 0) return true;
            else return false;
        }

        /// <summary>
        /// Converts XY coordinate to polar coordinate
        /// </summary>
        /// <param name="point">An XY coordinate</param>
        /// <returns>A polar r/φ coordinate</returns>
        public static PointF XY2Polar(PointF point) {
            return new PointF() {
                X = (float)(Rad2Deg(Atan2(point.Y, point.X))),
                Y = (float)Sqrt(point.X * point.X + point.Y * point.Y)
            };
        }

        /// <summary>
        /// Returns the constellation having the point defined by J2000 equatorial coordinate.
        /// </summary>
        /// <param name="ra">J2000 right ascension in decimal degress (NOT HOURS!!!)</param>
        /// <param name="de">J2000 declination in decimal degrees</param>
        /// <returns>When detected, 3-letter IAU abbreviation of the constellation</returns>
        public static string GetConstellationFromJ2000Coordinates(double ra, double de) {
            var point = PointF.Empty;
            var R = 0.0;
            var PHI = 0.0;
            Dictionary<string, ConstellationDataXY> dataSrc = null;
            if (de > 0) {
                // North
                R = 90.0 - de;
                PHI = Deg2Rad(ra);
                dataSrc = NorthConstellations;
            }
            else {
                // South
                R = 90.0 + de;
                PHI = Deg2Rad(-ra);
                dataSrc = SouthConstellations;
            }
            point.X = (float)(R * Cos(PHI));
            point.Y = (float)(R * Sin(PHI));
            foreach (var item in dataSrc.Keys) {
                if (IsPointInPolygon(point, dataSrc[item].Boundary.ToList())) return item;
            }
            return "N/A";
        }

        // Initialize our class
        static Constellations() {
            // initalize NorthConstellations
            var nc = Boundaries.Where(_ => _.Value.Location == HemiSphere.North || _.Value.Location == HemiSphere.Equatorial);
            foreach (var item in nc) NorthConstellations.Add(item.Key, new ConstellationDataXY() {
                Centroid = Polar2XY(new PointF[] { item.Value.Centroid }, HemiSphere.North)[0],
                Boundary = Polar2XY(item.Value.Boundary, HemiSphere.North)
            });
            nc = null;

            // initalize SouthConstellations
            var sc = Boundaries.Where(_ => _.Value.Location == HemiSphere.South || _.Value.Location == HemiSphere.Equatorial);
            foreach (var item in sc) SouthConstellations.Add(item.Key, new ConstellationDataXY() {
                Centroid = Polar2XY(new PointF[] { item.Value.Centroid }, HemiSphere.South)[0],
                Boundary = Polar2XY(item.Value.Boundary, HemiSphere.South)
            });
            sc = null;

            // initialize NorthSegments and SouthSegments
            foreach (var key in BoundarySegments.Keys) {
                var poly = BoundarySegments[key];
                NorthSegments.Add(key, Polar2XY(poly, HemiSphere.North));
                SouthSegments.Add(key, Polar2XY(poly, HemiSphere.South));
            }
        }
    }
}
